import React from 'react';
import {NoteType} from '../types/notesTypes'
import NoteItem from './NoteItem';

interface TableProps {
  notes: NoteType[],
  children: string,
}


const Table: React.FC<TableProps> = ({
    notes,
    children
  }) => {


  return (
    <div>
        <h1>{children}</h1>
        {notes.map((note) => 
          <NoteItem note = {note} typeTable='ff'/>
        )}
    </div>
  );
}
  
  
export default Table;
